    "48713": {
        "Desc": "",
        "Talk": [
            [
                {
                    "N": "Венти",
                    "T": "Так это у вас котик потерялся."
                },
                {
                    "N": "_1005",
                    "T": "Венти! Ты пришёл, чтобы помочь нам?"
                },
                {
                    "N": "Венти",
                    "T": "Я? Помочь вам? Вообще-то помощь нужна мне!"
                },
                {
                    "N": "_1005",
                    "T": "Но Паймон заметила, как ты говоришь с Маргаритой о Принце..."
                },
                {
                    "N": "Венти",
                    "T": "Принц! Значит, так зовут кота, который стащил мои <color=#00E1FFFF>струны из астрального железа</color>."
                },
                {
                    "N": "Венти",
                    "T": "Хоть мне и греет душу то, что свободный дух Мондштадта живёт и в братьях наших меньших, я всё равно нахожу его поступок возмутительным."
                },
                {
                    "N": "Маргарита",
                    "T": "Ха-ха! Принц - коварный маленький разбойник!"
                },
                {
                    "N": "_0",
                    "T": "Говоришь, как родитель, любящий баловать своё дитя..."
                },
                {
                    "N": "_1005",
                    "T": "Да. Прямо как Барбатос..."
                },
                {
                    "N": "Венти",
                    "T": "Какое меткое сравнение... Кхм, а теперь давайте отправимся на встречу с его избалованным высочеством, разбойничьим Принцем Мондштадта!"
                },
                {
                    "N": "Венти",
                    "T": "У меня сегодня выступление. Струны мне более чем понадобятся."
                },
                {
                    "N": "_1005",
                    "T": "Зачем котику вообще понадобились струны?"
                },
                {
                    "N": "Маргарита",
                    "T": "Ни один котик не сможет устоять перед клубком."
                },
                {
                    "N": "_1005",
                    "T": "Клубком?"
                },
                {
                    "N": "Венти",
                    "T": "Эти струны сделаны из астрального железа, пропитанного Анемо энергией. Они очень прочные, поэтому я обычно сматываю их в клубок. Так удобней."
                },
                {
                    "N": "Венти",
                    "T": "Секреты опытного барда."
                },
                {
                    "N": "_1005",
                    "T": "Ты сказал, что струны пропитаны Анемо энергией?"
                },
                {
                    "N": "_1005",
                    "T": "#Это должно сработать! {NICKNAME}, используй <color=#00E1FFFF>чувство стихий</color>!"
                }
            ]
        ]
    },
    "49001": {
        "Desc": "Расспросите Барбару о Джинн",
        "Talk": [
            [
                {
                    "N": "_1005",
                    "T": "Барбара, мы вернулись!"
                },
                {
                    "N": "Барбара",
                    "T": "С возвращением! Должно быть, вы очень устали."
                },
                {
                    "N": "_0",
                    "T": "Как себя чувствует Джинн?"
                },
                {
                    "N": "_0",
                    "T": "Барбара наверняка тоже устала."
                },
                {
                    "N": "Барбара",
                    "T": "Я в порядке. Ухаживать за пациентами - это моя работа."
                },
                {
                    "N": "Барбара",
                    "T": "Джинн пришла в себя, но она по-прежнему очень слаба."
                },
                {
                    "N": "_1005",
                    "T": "Правда? Пойдём поговорим с ней!"
                },
                {
                    "N": "Барбара",
                    "T": "Она только что покинула собор. Я пыталась уговорить её остаться, но она даже не стала меня слушать."
                },
                {
                    "N": "Барбара",
                    "T": "Сказала, что хочет подышать свежим воздухом. Наверняка снова пошла к <color=#00E1FFFF>леди Веннессе</color>."
                },
                {
                    "N": "_1005",
                    "T": "К леди Веннессе?"
                },
                {
                    "N": "Барбара",
                    "T": "К <color=#00E1FFFF>огромному дереву в долине Ветров</color>. Это место посвящено леди Веннессе, герою Мондштадта."
                },
                {
                    "N": "Барбара",
                    "T": "В тяжёлые минуты Джинн всегда ищет совета у Веннессы."
                },
                {
                    "N": "_1005",
                    "T": "Это очень личное. Барбара, откуда ты так хорошо знаешь Джинн?"
                },
                {
                    "N": "Барбара",
                    "T": "Она... Ммм... Сама рассказала мне об этом, перед тем как уйти."
                },
                {
                    "N": "_0",
                    "T": "Она ещё не полностью восстановилась, верно?"
                },
                {
                    "N": "_0",
                    "T": "Сможет ли она защитить себя в случае опасности?"
                },
                {
                    "N": "Барбара",
                    "T": "Я переживаю за неё. Но у меня ещё очень много работы в соборе."
                },
                {
                    "N": "_1005",
                    "T": "Не переживай. Мы возьмём это на себя."
                },
                {
                    "N": "Барбара",
                    "T": "Фух! Теперь я спокойна за судьбу Джинн. Да хранит вас Барбатос."
                }
            ]
        ]
    },
